import React from 'react'

function Button({button, filter}) {
    return (
        <div className="buttons">
            {

                button.map((cat, i)=>{
                    return <button type="button" onClick={()=> filter(cat)} className="btn"><img src='http://localhost:3001/static/media/blog4.60aa6cec.svg' alt=""/>{cat}</button>
                })
            }
        </div>
    )
}

export default Button;
